import React from 'react';
import './App.css';
import Fragment from 'render-fragment';
import 'bootstrap/dist/css/bootstrap.min.css';

import NavigationBar from './vue/navigationBar.js';
import { Switch, BrowserRouter, Route } from "react-router-dom";

import Formu from './vue/admin.js';
import Liste from './vue/liste.js';
import Homepage from './vue/homepage.js';



class App extends React.Component {


  render() {
    return (
      <Fragment >

      <BrowserRouter>
      <Switch>

          <Route path="/" exact component={NavigationBar} />
          <Route path="/" exact component={Homepage}/>
          <Route path = "/User" component= {Liste} />
            <br />


      </Switch>
      </BrowserRouter>





      </Fragment>
    );
  }

}


export default App;
